      private final String name;
      private final String sound;
      private final String headHash;
      private final UUID headUUID;

      final HeadDrop instance = HeadDrop.getInstance();

      EntityHead(String name, String sound, String headHash) {
            this.name = name;
            this.sound = sound;
            this.headHash = headHash;
            this.headUUID = UUID.nameUUIDFromBytes(headHash.getBytes());
      }
      public ItemStack getSkull() {
            ItemStack skull = SkullCreator.createSkullWithBase64(headHash, headUUID);
            if (skull.getType().equals(Material.PLAYER_HEAD)) {
                  SkullMeta meta = (SkullMeta) skull.getItemMeta();
                  try {
                        if (instance.getConfiguration().getString(name + ".Sound", "default").equals("default")) {
                              meta.setNoteBlockSound(NamespacedKey.minecraft(sound));
                        } else meta.setNoteBlockSound(NamespacedKey.minecraft(instance.getConfiguration().getString(name + ".Sound")));
                  }catch (NoSuchMethodError ignored){}
                  skull.setItemMeta(meta);
            }
            if (!HeadDrop.getInstance().getConfiguration().getBoolean(name + ".Drop")){
                  return null;
            }

            ItemMeta meta = skull.getItemMeta();
            String formattedName = name.substring(0, 1).toUpperCase() + name.substring(1).toLowerCase();
            formattedName = formattedName.replaceAll("_", " ") + "'s Head";
            Component displayName = Component.text(formattedName, NamedTextColor.YELLOW);
            meta.displayName(displayName);

            skull.setItemMeta(meta);
            return skull;
      }

      public String getName() {
            return name;
      }
      public String getHeadHash(){
            return headHash;
      }
      public String getSound(){
            return sound;
      }
